import Comptest from './Comptest';
import logo from './faty.jpg';
import flr from './flr.jpg';

export default function Teste() {
    return (
      <div className="Teste">
        <Comptest size={{width:300 , height:500}}
        name={'image'}
        mnclass={'logo'}
        H1={'Cup of cofee'}
        logo1={logo}
        text={'It\'s time for coofee'}
        prix={'50$'}/>

      <Comptest size={{width:300 , height:500}}
      name={'image1'}
      mnclass={'logo'}
      H1={'Flower'}
      logo1={flr}
      text={'IWht'}
        prix={'50$'}/>
    </div>
    );
  }
